import axios from "axios";

const API_URL = "http://localhost:4000/api";

const matchService = {
  createMatch: async ({ duration, gameMode }) => {
    try {
      const response = await axios.post(`${API_URL}/create`, { duration, gameMode });
      return response.data;
    } catch (error) {
      console.error("API Error:", error.response?.data || error.message);
      throw error;
    }
  },

  getMatch: async (matchId) => {
    try {
      const response = await axios.get(`${API_URL}/match/${matchId}`);
      return response.data;
    } catch (error) {
      console.error("Error fetching match:", error.response?.data || error.message);
      throw error;
    }
  },
};


export { matchService };
